// loginUser.js 또는 signupUser.js
import axios from './Axios';

const fetchData = async () => {
  try {
    const response = await axios.get('/api/data');
    console.log(response.data);
  } catch (error) {
    console.error('데이터 가져오기 에러:', error);
  }
};

fetchData();
